import React, { Component } from 'react';
import './Header.css';
import Icon from './symitems.png'

class Header extends Component {

  render() {
    return (
      <h1 className="Icon-background"><img src={Icon}  alt="アイコン" /></h1>
    );
  }
}

export default Header;
